import { TestBed } from '@angular/core/testing';
import { ChatEventService } from 'src/app/services/chat-event.service';
import { ChatStatisticsByHourComponent } from './hourly-chat-history.component';
describe('ChatStatisticsByHourComponent', () => {
    let component;
    let fixture;
    // let mockService = {getChatStatisticsByHour: () => {}};
    let fakeHourlyEvent;
    let httpClient;
    beforeEach(async () => {
        const chatEventServiceSpy = jasmine.createSpyObj('ChatEventService', ['getChatStatisticsByHour']);
        await TestBed.configureTestingModule({
            declarations: [ChatStatisticsByHourComponent],
            providers: [{ provide: ChatEventService, useValue: chatEventServiceSpy }]
        })
            .compileComponents();
    });
    beforeEach(() => {
        fixture = TestBed.createComponent(ChatStatisticsByHourComponent);
        component = fixture.componentInstance;
        fixture.detectChanges();
    });
    it('should create', () => {
        expect(component).toBeTruthy();
    });
});
